import React from 'react';
import styled from 'styled-components';

const FooterContainer = styled.footer`
  text-align: center;
  padding: 1rem;
  background: #333;
  color: #fff;
`;

const Footer = () => {
  return (
    <FooterContainer>
      <p>&copy; 2024 Recoopera. Todos os direitos reservados.</p>
    </FooterContainer>
  );
};

export default Footer;
